import React from 'react';
import ReactDOM from 'react-dom';

const Dice: React.FC = () => {
  const diceRolls = Array.from({ length: 5 }, () => 1); // generates an array of 5 ones

  return (
    <div id="dice-container">
      {diceRolls.map((roll, index) => (
        <div className="dice" key={index}>
          <img src="./images/dice1.png" alt="Dice 1" />
        </div>
      ))}
    </div>
  );
};

ReactDOM.render(<Dice />, document.getElementById('root'));
